# depthcsv_simple.py
# Requires: pip install numpy matplotlib

import re
import csv
import io
import numpy as np
import matplotlib.pyplot as plt

BIN_WIDTH = 0.0375  # metres per bin

def _parse_array_field(s):
    if not s:
        return np.array([])
    s = s.strip()
    if len(s) >= 2 and s[0] == '"' and s[-1] == '"':
        s = s[1:-1]
    if len(s) >= 2 and s[0] == '[' and s[-1] == ']':
        s = s[1:-1]
    parts = [p for p in s.split(';') if p.strip()]
    if not parts:
        return np.array([])
    return np.array([float(p) for p in parts], dtype=float)

def parse_depthcsv_line(line):
    """
    Parse one DepthCSV row (full Logcat line or raw payload).
    Supports an optional second field 'Z=<int>' for the zone.
    """
    m = re.search(r'DepthCSV:\s*(.*)$', line)
    payload = m.group(1) if m else line

    reader = csv.reader(io.StringIO(payload))
    try:
        fields = next(reader)
    except StopIteration:
        return None

    if not fields:
        return None

    kind = fields[0].strip().upper()
    idx = 1
    zone = None
    if len(fields) > 1 and isinstance(fields[1], str) and fields[1].strip().upper().startswith("Z="):
        try:
            zone = int(fields[1].split("=", 1)[1])
        except Exception:
            zone = None
        idx = 2  # shift because Z=... consumed a slot

    rec = {"kind": kind, "zone": zone}

    if kind == "ECHO" and len(fields) >= idx + 5:
        rec.update({
            "hist":   _parse_array_field(fields[idx + 0]),
            "deriv":  _parse_array_field(fields[idx + 1]),
            "dderiv": _parse_array_field(fields[idx + 2]),
            "maxima": _parse_array_field(fields[idx + 3]),  # bin indices
            "pts":    _parse_array_field(fields[idx + 4]),  # metres
        })
    elif kind == "DECONV" and len(fields) >= idx + 6:
        rec.update({
            "hist":   _parse_array_field(fields[idx + 0]),
            "deconv": _parse_array_field(fields[idx + 1]),
            "deriv":  _parse_array_field(fields[idx + 2]),
            "dderiv": _parse_array_field(fields[idx + 3]),
            "maxima": _parse_array_field(fields[idx + 4]),  # bin indices
            "pts":    _parse_array_field(fields[idx + 5]),  # metres
        })
    elif kind == "DECOMP" and len(fields) >= idx + 5:
        rec.update({
            "hist":  _parse_array_field(fields[idx + 0]),
            "fit":   _parse_array_field(fields[idx + 1]),
            "comp1": _parse_array_field(fields[idx + 2]),
            "comp2": _parse_array_field(fields[idx + 3]),
            "peaks": _parse_array_field(fields[idx + 4]),  # metres
        })
    else:
        return None

    return rec

def _x_m(n: int) -> np.ndarray:
    """X axis in metres for n bins."""
    return np.arange(n, dtype=float) * BIN_WIDTH

def plot_record(rec):
    kind = rec["kind"].upper()
    zone = rec.get("zone")
    zone_txt = f" (Z={zone})" if zone is not None else ""

    if kind == "ECHO":
        y = rec["hist"]; d1 = rec["deriv"]; d2 = rec["dderiv"]
        x = _x_m(len(y))
        plt.figure()
        if len(y):  plt.plot(x, y, label="hist")
        if len(d1): plt.plot(x, d1, label="deriv")
        if len(d2): plt.plot(x, d2, label="dderiv")

        # maxima are in bins -> convert to metres
        if rec["maxima"].size:
            max_x_m = rec["maxima"] * BIN_WIDTH
            y_interp = np.interp(max_x_m, x, y, left=np.nan, right=np.nan) if len(y) else np.full_like(max_x_m, np.nan)
            plt.scatter(max_x_m, y_interp, marker="x", label="maxima (bin→m)")

        # pts are already metres -> vertical guides
        if rec["pts"].size:
            for p in rec["pts"]:
                plt.axvline(p, linestyle="--", alpha=0.5)
        plt.title("Echo detection" + zone_txt)
        plt.xlabel("Distance (m)")
        plt.ylabel("Amplitude (normalized)")
        plt.legend()
        plt.tight_layout()
        plt.show()

    elif kind == "DECONV":
        y = rec["hist"]; ydc = rec["deconv"]; d1 = rec["deriv"]; d2 = rec["dderiv"]
        n = max(len(y), len(ydc), len(d1), len(d2))
        x_full = _x_m(n)

        plt.figure()
        if len(y):   plt.plot(_x_m(len(y)),   y,   label="hist")
        if len(ydc): plt.plot(_x_m(len(ydc)), ydc, label="deconv")
        if len(d1):  plt.plot(_x_m(len(d1)),  d1,  label="deriv")
        if len(d2):  plt.plot(_x_m(len(d2)),  d2,  label="dderiv")

        # maxima are in bins -> convert to metres; interpolate on deconv if available, else on hist
        if rec["maxima"].size:
            max_x_m = rec["maxima"] * BIN_WIDTH
            base_x = _x_m(len(ydc)) if len(ydc) else _x_m(len(y))
            base_y = ydc if len(ydc) else y
            y_interp = np.interp(max_x_m, base_x, base_y, left=np.nan, right=np.nan) if len(base_y) else np.full_like(max_x_m, np.nan)
            plt.scatter(max_x_m, y_interp, marker="x", label="maxima (bin→m)")

        # pts are already metres -> vertical guides
        if rec["pts"].size:
            for p in rec["pts"]:
                plt.axvline(p, linestyle="--", alpha=0.5)

        plt.title("Wiener deconvolution" + zone_txt)
        plt.xlabel("Distance (m)")
        plt.ylabel("Amplitude (normalized)")
        plt.legend()
        plt.tight_layout()
        plt.show()

    elif kind == "DECOMP":
        y = rec["hist"]; fit = rec["fit"]; c1 = rec["comp1"]; c2 = rec["comp2"]
        n = max(len(y), len(fit), len(c1), len(c2))
        plt.figure()
        if len(y):   plt.plot(_x_m(len(y)),   y,   label="hist")
        if len(fit): plt.plot(_x_m(len(fit)), fit, label="fit")
        if len(c1):  plt.plot(_x_m(len(c1)),  c1,  label="comp1")
        if len(c2):  plt.plot(_x_m(len(c2)),  c2,  label="comp2")

        # peaks are already metres
        if "peaks" in rec and rec["peaks"].size:
            base_x = _x_m(len(fit)) if len(fit) else _x_m(len(y))
            base_y = fit if len(fit) else y
            y_interp = np.interp(rec["peaks"], base_x, base_y, left=np.nan, right=np.nan) if len(base_y) else np.full_like(rec["peaks"], np.nan)
            for p in rec["peaks"]:
                plt.axvline(p, linestyle="--", alpha=0.5)
            plt.scatter(rec["peaks"], y_interp, marker="o", label="peaks (m)")

        plt.title("Waveform decomposition" + zone_txt)
        plt.xlabel("Distance (m)")
        plt.ylabel("Amplitude (normalized)")
        plt.legend()
        plt.tight_layout()
        plt.show()
    else:
        print("Unknown kind:", kind)

def plot_line(line):
    rec = parse_depthcsv_line(line)
    if not rec:
        print("Could not parse DepthCSV line.")
        return
    plot_record(rec)

from mpl_toolkits.mplot3d import Axes3D  # noqa: F401 (needed for 3D)

def _iter_lines(lines):
    """Accept a list/iterable of lines OR a single multiline string."""
    if isinstance(lines, str):
        for ln in lines.splitlines():
            ln = ln.strip()
            if ln:
                yield ln
    else:
        for ln in lines:
            if ln:
                yield str(ln).strip()

def plot_points(lines):
    """
    Plot all points from all zones on a 3D scatter:
      X = column (0..7), Y = row (0..7), Z = distance (metres).
    'lines' can be a list/iterable of CSV lines or a single multiline string.
    Lines must include 'Z=<zone>' to place points on the grid.
    """
    xs, ys, zs = [], [], []

    for ln in _iter_lines(lines):
        rec = parse_depthcsv_line(ln)
        if not rec:
            continue
        zone = rec.get("zone")
        if zone is None or not (0 <= zone <= 63):
            # Cannot place without a valid zone
            continue
        row, col = divmod(zone, 8)

        # Collect metres: pts (ECHO/DECONV) or peaks (DECOMP)
        if rec["kind"] in ("ECHO", "DECONV"):
            arr = rec.get("pts", np.array([], dtype=float))
        elif rec["kind"] == "DECOMP":
            arr = rec.get("peaks", np.array([], dtype=float))
        else:
            arr = np.array([], dtype=float)

        if arr is None or len(arr) == 0:
            continue

        # Append one (x,y) per distance point
        xs.extend([col] * len(arr))
        ys.extend([row] * len(arr))
        zs.extend(arr.tolist())

    if not zs:
        print("No points with valid zones were found.")
        return

    fig = plt.figure()
    ax = fig.add_subplot(111, projection="3d")
    ax.scatter(xs, ys, zs, marker="o")
    ax.set_xlabel("Zone column")
    ax.set_ylabel("Zone row")
    ax.set_zlabel("Distance (m)")
    ax.set_title("All zones: points in metres (8×8)")
    # Optional: set view for nicer angle
    ax.view_init(elev=20, azim=-60)
    plt.tight_layout()
    plt.show()

